import React, { Component, Fragment } from 'react';
import { Link } from "react-router-dom";

class Mynav extends Component{

    render (){
        return (
            <Fragment>
        <div>
            <ul>
                <li><Link exact activeStyle={{color: 'red'}} to='/'>NewHome</Link></li>
                <li><Link exact activeStyle={{color: 'green'}} to='/NewAbout/My Name Is Ismail Saheb'>NewAbout</Link></li>
                <li><Link exact activeStyle={{color: 'red'}} to='/NewContact'>NewContact</Link></li>
            </ul>
         </div>
            </Fragment>
        )
    }
}
export default Mynav;
